import React, { Component } from 'react';
import './flexbox.css';

class ComicList extends Component {
    constructor (props){
        super()
        this.state = {
            id: props.id,
            title: props.title,
            date: props.date,
            creators: props.name,
            cover: props.path
        };
    }
    render() {
        return(
            <div className="comicThread" >
                <ul>
                    <li className="comicItem" key={this.state.id}>
                        {props.title}
                        {props.date}
                        {props.creators}
                        {props.cover}
                    </li>

                </ul>
            </div>
        );
    }
}

export default ComicList;
